import React, {Component} from 'react';
import { PageHeader } from 'antd';

class App extends Component {
  render(){
    return (
        <PageHeader
            theme="dark"
            onBack={() => null}
            title="Title"
            subTitle="This is a subtitle"
        />
    );
  }
}


export default App;
